import React from 'react';

import { Link, useNavigate } from 'react-router-dom';

function Dashboard() {
  return (
   <div>
     <header>
     <Link itemProp="url" to="/signup">
          Logout
        </Link>
     </header>
   </div>
  );
}

export default Dashboard;
